import React from "react";
import { Container, Img, Logo, NavBox, Profile } from "./Navbar.styled";
import HomeOutlinedIcon from "@mui/icons-material/HomeOutlined";
import SearchOutlinedIcon from "@mui/icons-material/SearchOutlined";
import ExploreOutlinedIcon from "@mui/icons-material/ExploreOutlined";
import SendOutlinedIcon from "@mui/icons-material/SendOutlined";
import FavoriteBorderOutlinedIcon from "@mui/icons-material/FavoriteBorderOutlined";
import { useSelector } from "react-redux";

const Navbar = () => {
    const navProfile = useSelector()
  return (
    <Container>
      <Logo>
        <Img
          src="https://blackhillsballoons.com/wp-content/uploads/2021/01/Instagram-Logo.png"
          alt="logo"
        />
      </Logo>
      <NavBox>
        <HomeOutlinedIcon />
        <p>Home</p>
      </NavBox>
      <NavBox>
        <SearchOutlinedIcon />
        <p>Search</p>
      </NavBox>
      <NavBox>
        <ExploreOutlinedIcon />
        <p>Explore</p>
      </NavBox>
      <NavBox>
        <SendOutlinedIcon />
        <p>Messages</p>
      </NavBox>
      <NavBox>
        <FavoriteBorderOutlinedIcon />
        <p>Notifications</p>
      </NavBox>
      <NavBox>
        <Profile
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRQ--rJ7Xa-1PtEpg5FjvgqjKda1FF9lUKrvg&usqp=CAU"
          alt="profile"
        />
        <p>Profile</p>
      </NavBox>
    </Container>
  );
};

export default Navbar;
